import * as React from 'react';
import Box from '@mui/material/Box';
import Backdrop from '@mui/material/Backdrop';
import SpeedDial from '@mui/material/SpeedDial';
import SpeedDialAction from '@mui/material/SpeedDialAction';
import PhoneIcon from '@mui/icons-material/Phone';
import TelegramIcon from '@mui/icons-material/Telegram';
import WhatsAppIcon from '@mui/icons-material/WhatsApp';
import ViberIcon from '@mui/icons-material/PhoneInTalk';
import EmailIcon from '@mui/icons-material/Email';
import "./styleSpeedDial.css"
import {Link} from "react-router-dom";



const style = {
    margin: 0,
    right: 20,
    bottom: 20,
    position: 'fixed',
};

const actions = [
    { icon: <TelegramIcon style={{ fill: '#000000' }} />,
        name: 'Telegram', link: "https://t.me/rkindrat" },
    { icon: <WhatsAppIcon style={{ fill: '#000000' }} />,
        name: 'LinkedIn', link: "https://www.google.com/" },
    { icon: <ViberIcon style={{ fill: '#000000' }} />,
        name: 'Twitter', link: "https://www.google.com/" },
    { icon: <EmailIcon style={{ fill: '#000000' }} />,
        name: 'Instagram', link: "https://www.google.com/" },
];

export default function Socials() {
    const [open, setOpen] = React.useState(false);
    const handleOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };
    return (
        <div>
            <SpeedDial
                ariaLabel="SpeedDial openIcon example"
                style={style}
                hidden={false}
                icon={<PhoneIcon openIcon={<PhoneIcon />} />}
                onClose={handleClose}
                onOpen={handleOpen}
                open={open}
            >
                {actions.map((action) => (
                    <SpeedDialAction
                        key={action.name}
                        icon={action.icon}
                        tooltipTitle={action.name}
                        onClick={handleClose}
                        href={action.link}

                    />
                ))}
            </SpeedDial>
        </div>
    );
}
